        Job Postmus\",\"email\":\"sjoerdjob@sjec.nl\",\"date\":\"2016-11-12T11:19:37Z\"},\"message\":\"Several
        amendmants to DEP0201.\\n\\n- Being more specific on how to define a type
        converter.\\n- Mentioning the fact that parametrized type converters are a
        bit less\\n  specified (as of now) in contrast to the non-parametrized type
